import {
  Stack,
  Drawer,
  AppBar,
  Toolbar,
  IconButton,
  MenuIcon
} from "@mui/material";
import DashboardIcon from '@mui/icons-material/Dashboard';
let width=250;
const Admin = ()=>{
  const design = (
    <>
      <Stack sx={{
        width:`${width}`,
        bgcolor:"#ccc"
      }}>
        <Drawer variant="permanent"
        sx={{
          width:`${width}`,
          bgColor: "#f5f5f5"
        }}
        >
        </Drawer>
      </Stack>
    </>
  );
  return design;
}
export default Admin;
